%[text] This script demonstrates how the merging insulin function operates by working an irregular bolus and basal time series into one resampled table of combined total insulin.
% Create example datasets
basalTT = timetable(datetime("today") + hours([0 0.5 1 3 12 37 39])',[1 2 1 4 2 4 1]','VariableNames',"basal_rate");
bolusTT = timetable(datetime("today") + hours([4 8 12 30 38 40])',[1 12 3 2 2 12]',minutes([0 60 0 0 0 60])',...
    'VariableNames',["bolus" "delivery_duration"]);
%[text] Using the interpolateBasal and interpolateBolus functions to display the standard resampling. No gaps are introduced to the datasets.
basalResampled = AIDIF.interpolateBasal(basalTT);
bolusResampled = AIDIF.interpolateBolus(bolusTT);
%[text] Now, combine the functions
mergedInsulin = AIDIF.mergeTotalInsulin(basalTT,bolusTT,hours(24)) %[output:6c839928]
tiledlayout(3,1);nexttile %[output:990074d7]
stem(basalResampled,"Time","InsulinDelivery");ylabel('basal insulin');ylim([0 4]);nexttile %[output:990074d7]
stem(bolusResampled,"Time","InsulinDelivery");ylabel('bolus insulin');ylim([0 4]);nexttile %[output:990074d7]
stem(mergedInsulin,"Time","totalInsulin");ylabel('merged insulin');ylim([0 4]) %[output:990074d7]
%[text] <u>Expected Results:</u>
%[text] - total insulin is the summation of basal and bolus insulin amounts for each timestep.
%[text] - The basal time series determines the start and end points for the merged insulin data.
%[text] - Gaps in the basal or bolus data greater than 24 hours are condsidered NaN
%[text] - All NaN values found in either the basal or bolus data are maintained. \
%[text] 
